import { ContentPage } from '../styled/Components';

const scheduleData = [
	{
		name: "Monday",
		hours: [
			{course: "Calculus", hour: 1},
			{course: "Physics", hour: 2}
		]
	},
	{
		name: "Tuesday",
		hours: [
			{course: "Calculus", hour: 1},
			{course: "Physics", hour: 2}
		]
	}
];

const Schedule = () => {
	return (
		<ContentPage title="Schedule">
			{scheduleData.map(day => {
				<Day day={day} />
			})}
		</ContentPage>
	);
}

const Day = (props: any) => {
	return (
		<div>
			{props.day.name}
		</div>
	);
}

